import React from 'react';
import Work from './workTime';
import NonWork from './NonWorkTime';
const Home = ()=>{
    return(
        <>
        <h1>Restrictions</h1>
        <div className='row'>
            <div className='col-4 mt-4'>
                <button className='btn btn-primary'>Work Time</button>
                <button className='btn btn-light'>Non-Work Time</button>
            </div>
            <div className='col-12 mt-5'>
                    <Work/>
            </div>
        </div>
       
        </>
    )
}

export default Home
